oxy_webhelp_navlinks = {"con_other.dita-d4802e3424":{"topics":[{"title":"Synchronizing contacts with iNotes速 and mobile devices","shortdesc":"<p class=\"shortdesc\">You can synchronize contacts with iNotes速 and mobile devices, so you have the same contacts in both places.<\/p>","href":"con_synchronize_t.html","attributes":{"data-id":"con_syncrhonize_contacts_t"},"menu":{"hasChildren":false},"tocID":"con_syncrhonize_contacts_t-d4802e3435","topics":[]},{"title":"Adding or updating contacts from an email, meeting invitation, or to do item","shortdesc":"<p class=\"shortdesc\">You can add a new contact from an email, meeting invitation, or to do item you receive. If you receive mail from an existing contact who has a new email address, you can also update the existing contact record.<\/p>","href":"con_add_fr_mail_mtg_task_t.html","attributes":{"data-id":"N10001"},"menu":{"hasChildren":false},"tocID":"N10001-d4802e3452","topics":[]},{"title":"Sending someone a contact or group","shortdesc":"<p class=\"shortdesc\">You can send a contact or group entry to another user. Note, however, that HCL Notes速 email addresses (for example, Jane Q Public\/Acme\/Sales) are useful only if the recipient uses Notes Mail.<\/p>","href":"con_send_con_group_t.html","attributes":{"data-id":"con_send_group_entry_t"},"menu":{"hasChildren":false},"tocID":"con_send_group_entry_t-d4802e3463","topics":[]},{"title":"Creating a group from an email","shortdesc":"<p class=\"shortdesc\">You can create a group entry from a message, meeting invitation, or to do item that you    receive.<\/p>","href":"con_create_group_fr_mail_t.html","attributes":{"data-id":"con_create_group_from_mail_t"},"menu":{"hasChildren":false},"tocID":"con_create_group_from_mail_t-d4802e3480","topics":[]},{"title":"Showing or hiding group members' names when sending an email","shortdesc":"<p class=\"shortdesc\">If you address a message to a group in your contact list, you can prevent or allow recipients to see the members of the group in the message.<\/p>","href":"con_show_hide_names_t.html","attributes":{"data-id":"con_show_hide_names_t"},"menu":{"hasChildren":false},"tocID":"con_show_hide_names_t-d4802e3491","topics":[]},{"title":"Printing contacts","shortdesc":"<p class=\"shortdesc\">You can print out your contacts as labels, print a contact entry to see all of the information about a contact or a group, or print the contact information as it appears in a view.<\/p>","href":"con_printing_t.html","attributes":{"data-id":"con_print_contact_or_group_t"},"menu":{"hasChildren":false},"tocID":"con_print_contact_or_group_t-d4802e3502","topics":[]},{"title":"Importing contacts from other sources","shortdesc":"<p class=\"shortdesc\">If you have contacts from other sources, you can import those contacts into your HCL Notes速 contacts.<\/p>","href":"con_import_contacts_t.html","attributes":{"data-id":"con_import_contacts_t"},"menu":{"hasChildren":false},"tocID":"con_import_contacts_t-d4802e3513","topics":[]},{"title":"Exporting contacts","shortdesc":"<p class=\"shortdesc\">You can export contacts from Notes and import them into other programs.<\/p>","href":"con_export_t.html","attributes":{"data-id":"con_export_contacts_t"},"menu":{"hasChildren":false},"tocID":"con_export_contacts_t-d4802e3527","topics":[]}]}};